import React from 'react'
import styled,{css} from 'styled-components/macro';

const mainSection=styled.section`
height:100vh;
max-height:1100px;
postion:relative;
overflow:hidden;


`;
const mainWrapper=styled.div`
width:100%;
height:100%;
display: flex;
justify-content: center;
overflow: hidden;
position: relative;
`;

const Main = () => {
    return (
       <mainSection>
           <mainWrapper>
           <h1>I am here</h1>
           </mainWrapper>
       </mainSection>
    )
}

export default Main
